import React, { useEffect, useState } from "react";
import Navbar from "../components/Navbar";
import { Link } from "react-router-dom";
import axios from "axios";

function AdminDashboard() {
  const [admin, setAdmin] = useState({
    userID: "",
    firstName: "",
    lastName: "",
    contactNo: "",
    email: "",
    role: ""
  });

  const [farmers, setFarmers] = useState([]);
  const [shopkeepers, setShopkeepers] = useState([]);
  const [buyers, setBuyers] = useState([]);

  useEffect(() => {
    const storedUser = sessionStorage.getItem("user");
    if (storedUser) {
      setAdmin(JSON.parse(storedUser));
    }
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const farmersResponse = await axios.get("https://localhost:7299/api/Farmers");
      setFarmers(farmersResponse.data);

      const shopkeepersResponse = await axios.get("https://localhost:7299/api/Shopkeepers");
      setShopkeepers(shopkeepersResponse.data);

      const buyersResponse = await axios.get("https://localhost:7299/api/Buyers");
      setBuyers(buyersResponse.data);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  return (
    <div className="container">
      <Navbar />
      <h2 className="mt-4">Admin Dashboard</h2>
      <div className="card p-4 shadow mt-3">
        <h3>Admin Details</h3>
        <p><strong>Name:</strong> {admin.firstName} {admin.lastName}</p>
        <p><strong>Email:</strong> {admin.email}</p>
        <p><strong>Contact No:</strong> {admin.contactNo}</p>
      </div>
      <div className="mt-3">
        <Link to="/FeedbackDashboard" className="btn btn-primary">
          View Feedbacks
        </Link>
      </div>
      <div className="mt-3">
        <h3>Farmers</h3>
        <ul className="list-group">
          {farmers.map((farmer) => (
            <li key={farmer.userID} className="list-group-item">{farmer.firstName} {farmer.lastName} - {farmer.email}</li>
          ))}
        </ul>
      </div>
      <div className="mt-3">
        <h3>Shopkeepers</h3>
        <ul className="list-group">
          {shopkeepers.map((shopkeeper) => (
            <li key={shopkeeper.userID} className="list-group-item">{shopkeeper.firstName} {shopkeeper.lastName} - {shopkeeper.email}</li>
          ))}
        </ul>
      </div>
      <div className="mt-3">
        <h3>Buyers</h3>
        <ul className="list-group">
          {buyers.map((buyer) => (
            <li key={buyer.userID} className="list-group-item">{buyer.firstName} {buyer.lastName} - {buyer.email}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default AdminDashboard;
